    // Find first question that hasn't been submitted yet
    const firstUnattemptedIndex = questions.findIndex(q => !progress.results[q.id]?.submitted);

    setActiveQuizId(quizId);
    // If all questions are attempted, start from beginning (or we could show results, but user asked to start after attempted)
